■メーカー:ダイドー<br>■賞味期限:（メーカー製造日より）12カ月<br>■コーヒー本来の深い味わいと華やかな香り、そして余韻を楽しめるブラック無糖コーヒーです。製法は浅煎り・深煎りの“ダブル”ブレンドをはじめ、焙煎、粉砕、抽出など10種のポイントで“ダブル”のこだわりを投入した“10種ダブル製法”を採用。厳選したアラビカ種高級豆の持つ魅力的な味わいを引き出すことで、これまでのブラック無糖コーヒーの印象を一新する、豊かで複雑な味わいを実現しました。<img src="http://image.rakuten.co.jp/at-cvs/cabinet/raku-bnr/2case-otokuanime.gif" border="0"><!--▼おすすめ商品（目玉商品機能）タイトル画像-->
